INSERT INTO `blog` (`blog_id`, `title`, `author`, `author_img`, `blog_details`, `supporting_img`, `date_inserted`, `thumb`) VALUES
(1, 'Office Furniture Care and Maintenance', 'Zahra Salmorin', , 'Proper care will ensure the longest life of your office furniture system. Here are some simple tips to follow. The cleaning method will vary according to the surface finish/materials.\r\n<br/>\r\nKeep your furniture out of direct sunlight. Prolonged exposure may cause the color to fade over time. If possible try to avoid extreme changes in temperature. Protect the surface from dents, scratches, and moisture from hot or cold liquids.\r\n<br/>\r\nIf you choose to protect the surface with a glass top, use silicone bumpers or felt pads between the glass and wood surface.<br/>\r\nAvoid scratching or chipping of tops and panels , tearing or pulling of fabric by always moving the furniture pieces in the way of their intended use, via wheel caster lifting, not dragging.\r\n<br/>\r\nDo not sit on the arms or back of chairs.\r\n<br/>\r\nAlways handle your office partition carefully. Avoid excessive force (avoid leaning against the office partition and never lean ladders against the partitions).\r\n<br/>\r\nDo not sit on table top/worktop, because the table is already designed for a specific load.\r\n<br/>\r\nAvoid storing heavy loads on the shelf cabinets and glass shelves.\r\n<br/>\r\nReposition office equipment and accessories periodically on the surface of the desk to ensure even coloration as the unit ages.', 'main/img/blogs/art1.jpg', '2015-12-09', 'main/img/blogs/art101.jpg');
INSERT INTO `blog` (`blog_id`, `title`, `author`, `author_img`, `blog_details`, `supporting_img`, `date_inserted`, `thumb`) VALUES
(2, 'Fabric Care/Upholstered Seating', 'Zahra Salmorin', , 'Dirt and dust that remains in the fabric helps to break down the fabric fibers and contributes greatly to shorten the life of the fabric.<br/>\r\nWeekly vacuuming at least once a particular attention to the removal of dust between the fabric structure.<br/>Spillages should be cleaned with a soft damp cloth as soon as possible to avoid moisture damage.<br/>Oils andMinor spills should be quickly blotted out with an absorbent paper towel or clean cloth to avoid staining.<br/>If stain is still evident, repeat procedure. Several light applications of cleaning solution are more effective/less damaging than one heavy application.<br/>For tough spots and spills, professional upholstery cleaning is recommended.<br/>If the stain has dried, first brush any excess off by hand or with a brush. Then vacuum the stain, and follow by cleaning using soapy water.<br/>It is important to rinse with clean water afterwards.<br/>Never use furniture polishes, oils, varnishes it may cause discoloration and should be tested in an inconspicuous area before using.<br/>When cleaning stains with liquid solutions avoid over-saturation. Over-saturation distributes the stain deeper into the fiber.<br/>Avoid body with perspiration stains and dust sitting on the furniture to ensure the life of the furniture.<br/>Sharp objects can cause snagging, tearing or pulling of the fabric. Cut any loose threads off the upholstered seating, do not pull them.<br/>Pets and upholstered furniture do not mix. Hair, nails and scraping tugs hard on the fabric. Pets should be in their basket, not in the furniture.\r\n<br/>\r\nAvoid exposure to direct sunlight to prevent bleaching or dis colouration.\r\n<br/>\r\n<strong>Type of Stains</strong>\r\n<br/>\r\nAlcohol, Ballpoint pen, Blood, Butter, Chewing gum, Chocolate, Fruit juice, Furniture polish, Ink, Lipstick, Milk, Oil, Tea, Urine, Wine.\r\n<br/>\r\n<strong>Important maintenance factors</strong>\r\n<br/>\r\n1) main cleaning, 2) stain removal, 3) control of color fastness and precautions for upholstery fabrics\r\n', 'main/img/blogs/art2.jpg', '2015-12-09', 'main/img/blogs/fabric.jpg');
INSERT INTO `blog` (`blog_id`, `title`, `author`, `author_img`, `blog_details`, `supporting_img`, `date_inserted`, `thumb`) VALUES
(3, 'Wooden/Laminated Furniture Care', 'Zahra Salmorin', , 'Wood furniture requires care and maintenance to retain its uniqueness. It is not recommended in direct sunlight, near heat sources or in rooms where the climate swings. This may result cracks in glued connection.<br/>\r\nFor daily dusting, use a clean, slightly damp soft cloth and wipe in the direction of the wood grain. Dry with another soft cloth.<br/>Avoid products of water droplets on the surface of water or sediment long enough.<br/>Oils and ammonia should never be used on the wood furniture<br/>Do not use abrasive powders and scouring pads to clean the stains.<br/>Do not sit on tabletop.<br/>Use a desk pad to protect your wood surfaces from marks, scratches and rings left by glasses. Lift objects lying on the surface whenever possible, rather than dragging them.<br/>Use a quality cleaner or flax soap specially formulated for wood furniture.<br/>When moving the table, it is recommended to be lift up and not dragging or pushing.<br/>Avoid using a rough texture to the surface cleaning.<br/>You can also use a professional cleaning service to take care of furnishing your office equipment.', 'main/img/blogs/art3.jpg', '2015-12-09', 'main/img/blogs/wooden.jpg');
INSERT INTO `blog` (`blog_id`, `title`, `author`, `author_img`, `blog_details`, `supporting_img`, `date_inserted`, `thumb`) VALUES
(4, 'Leather Furniture Care', 'Zahra Salmorin', , '* Regular dusting and vacuum cleaning are the only necessary steps in caring for your product under normal conditions and use.<br/>* For general spots and stains, use a mild solution of non-detergent cleaner, then rinse with lukewarm water and allow the leather to air dry naturally.<br/>* For spots and stains caused from oils or grease, wipe with a soft day cloth and allow the spot to dissipate into the leather, without applying any water.<br/>* Do not use hair dryer.<br/>* Do not use special cleaning solvents, furniture polish, ammonia, oils, vanish, abrasive cleaners, saddle soap or any abrasive cleaners on leather, as it may cause discoloration.<br/>* If you find any holes Do not attempt to repair, contact qualified service personnel.<br/>\r\n<strong>Types of Stains</strong>\r\n<br/>\r\nBlack ballpoint pen, Coffee, Indelible ink, Grease, Ink pen, Sole marks and wax, Water-based felt pen', 'main/img/blogs/art4.jpg', '2015-12-09', 'main/img/blogs/leather.jpg');
INSERT INTO `blog` (`blog_id`, `title`, `author`, `author_img`, `blog_details`, `supporting_img`, `date_inserted`, `thumb`) VALUES
(5, 'Glass Furniture Care', 'Zahra Salmorin', , 'Glass is used for some table tops, and doors of cabinets and bookcases. It resists most chemicals and stains. It can be permanently scratched, so do not move rough objects across it, and do not use abrasives on it. Though table tops are heavy and strong, glass can be broken or cracked by hard blows.<br/>Avoid piling heavy items on your glass furniture.<br/>A regular maintenance schedule will help to keep your glass furniture clean and sparkling.<br/>If using spray cleaner bottle, spray only center of glass panel, and spread to edges with cloth, sponge or paper towels.<br/>Use window cleaner or a mixture of water and vinegar to get a streak-free glass.<br/>Avoid placing accent pieces that have sharp edges or rough bases directly on the glass top. If at all possible, keep your glass table away from high-traffic paths.\r\n<br/>To clean the glass surface by using detergent and a soft cloth or spoons and immediately cleaned with a dry cloth so that the glass does not cause scars.<br/>Buff dry with a clean lint-free cloth. Do not use solvents, scouring agents, carbon tetrachloride, undiluted bleach, janitorial cleansers or gasoline.\r\n', 'main/img/blogs/art5.jpg', '2015-12-09', 'main/img/blogs/glass.jpg');
INSERT INTO `blog` (`blog_id`, `title`, `author`, `author_img`, `blog_details`, `supporting_img`, `date_inserted`, `thumb`) VALUES
(6, 'Metal Furniture Care', 'Zahra Salmorin', , 'Metal materials in our products coated with powder coating to help protect the metal from the rusty metal. However, effort should be made to protect this layer. Regular maintenance of the dust should be conducted to help keep powder coated area last longer.<br/>Metal furniture in use, should not be overloaded. Shall not be affected by smoke, hot smoked.<br/>Prevent moisture and from corrosion and staining.\r\n<br/>When cleaning, use a dry cloth dipped in a little oil, wax.<br/>Regular checks of metal furniture folding, joints and rubber feet, if crack, rust, delamination is found, it should be repaired immediately.', 'main/img/blogs/Metal.jpg', '2015-12-09', 'main/img/blogs/art62.jpg');
INSERT INTO `blog` (`blog_id`, `title`, `author`, `author_img`, `blog_details`, `supporting_img`, `date_inserted`, `thumb`) VALUES
(7, 'Plastic Furniture Care', 'Zahra Salmorin', , 'Plastics in furniture are strong, but can be scratched, or dented by hard impacts.<br/>These materials are fairly resistant to damage from dirt. Regular dusting should help keep the surfaces free from dirt and help stop any scratches occurring.<br/>Avoid contact with boiling water, high heat.<br/>Do not use neat, steel brush as these may affect the colour and finish of the surface.<br/>Most can be cleaned with mild detergent (hand dishwashing liquid) and water, rinsed, and wiped dry.<br/>\r\nNever use abrasive cleaners like scouring powder.', 'main/img/blogs/Plast Furniture.jpg', '2015-12-09', 'main/img/blogs/plastic.jpg'),
(8, 'MINIMALIST DESIGN', 'Joseph Millena', , 'A minimal living room is obviously where the journey starts.<br/> \r\nDespite opting for a style that oozes sophistication, elegance and crisp straight lines, there is still plenty you can do to add character and unique personality to your minimal living space.<br/>\r\n"Simplicity is the ultimate form of SOPHISTICATION".\r\n<br/>\r\n<strong>Sources:</strong><br/>\r\n\r\n"Simplicity is the ultimate form of SOPHISTICATION".— Leonardo da Vinci quotes from BrainyQuote.com.<br/>\r\n\r\nRegarding the content, There is an existing blog site http://www.decoist.com/2014-03-17/minimalist-living-rooms/ \r\n\r\n', 'main/img/blogs/otep.jpg', '2015-12-11', 'main/img/blogs/minimalist.jpg');
INSERT INTO `blog` (`blog_id`, `title`, `author`, `author_img`, `blog_details`, `supporting_img`, `date_inserted`, `thumb`) VALUES
(9, 'Rendering your life', 'Joseph Millena', , 'Rendering is one of the process in 3d designing. An artistic tool that designer''s used to bring their design to life. It is a long process to do, but the more patient that you used in waiting, the more it is enhanced and become realistic. <br/>just like our personality and skills, each time we showed eagerness in work and patient to learn something more, we become more knowledgeable and skilled to our chosen field.', 'main/img/blogs/Rendering.jpg', '2015-12-11', 'main/img/blogs/rendered2.jpg'),
(10, 'Commitment to Clients', 'Angielyn H. Buenconsejo', , '<strong>JECAMS Inc.</strong> has provided high quality of goods and services for 3 years.We carefully listen to our customer''s needs.<br/> Understand their vision and do everything we can to exceed our customers expections. No matter how big and small the project will be, We go above and beyond to make the planning process enjoyable, unique and remarkable.', 'main/img/blogs/Commitment.jpg', '2015-12-11', 'main/img/blogs/commitments.jpg'),
(11, 'Floor Plan', 'Jeffrey Miguel Rodriguez', , 'A floor plan in architure and engineering is a scale drawing showing a perspective view from above. A floor plan also shows the relationship between rooms, spaces and other physical features in a certain structure. \r\n<br/>\r\nA floor plan usually show the measurement or dimension lines of an area and it may be drafted in a certain scale, which means reducing the size of an area proportion to fit a paper.\r\n<br/>\r\nIt also includes details of fixtures such as furnaces, construction notes and methods, or symbols for electrical items.\r\n<br/>\r\n<strong>Sources:</strong><br/>\r\nhttps://en.wikipedia.org/wiki/Floor_plan', 'main/img/blogs/jef2.jpg', '2015-12-11', 'main/img/blogs/jef3.jpg');
INSERT INTO `blog` (`blog_id`, `title`, `author`, `author_img`, `blog_details`, `supporting_img`, `date_inserted`, `thumb`) VALUES
(12, 'Presentation is Everything', 'Zahra Salmorin', , 'When you are trying to attract new clients to your business, presentation is everything. This applies to everything including how you furnish \r\nyour office. A well set up business office is a must because it creates a lasting impression on your clients. Even small businesses should have\r\na presentable office to welcome their clients. You want to convey a message of professionalism and attention to detail that instills confidence \r\nin your business and builds on your reputation. Jecams offers an office furniture solution  ranging from executive tables, meeting tables, \r\nconference tables, office desk, modern office furniture systems, office partition, office divider, workstation, cubicles, office chairs, clerical chair, \r\nstaff chairs, midback chairs, highback chairs, executive chairs, office tables, freestanding tables,  office sofa, and more.  \r\n<br/>\r\nThe possibilities are endless when you purchase from the best.  Jecams provides high end solutions for your particular office needs. \r\nIf you are going for a modern, sleek look, check out the sample photos below.', 'main/img/blogs/BLOGS.jpg', '2016-04-12', 'main/img/blogs/thumb1.jpg');
INSERT INTO `blog` (`blog_id`, `title`, `author`, `author_img`, `blog_details`, `supporting_img`, `date_inserted`, `thumb`) VALUES
(13, 'Call Center Setting', 'Zahra Salmorin', , 'Outsourcing jobs, such as call center attendants is very common  in countries like the United States.\r\nCompanies man call centers in countries such as India and Philippines because it is more cost effective.  \r\nThis type of employment is in big demand in the Philippines, which is why some schools are now offering \r\ncourses that prepare potential employees. \r\n<br/>\r\nCall center owners must  maximize their office space  by smartly designing their office  with function in mind. \r\nJecams  offers a great selection of this type of furniture.   With high end products, call center agents will be \r\nsure  to  improve  their productivity. I think that  setting a functional booths for a call center  station is a must in \r\norder to ensure that   call center agents will be able to  serve their customer very well and that they would be \r\ncomfortable  while dealing  with the customers. \r\n<br/>\r\nIf I am a call center agent, I would love to have a chair that would allow me to move freely from one point of my station to the the other  side so that when I am working on an account that requires a lot of information, mobility  \r\nwill be the key do my  job well. \r\n<br/>\r\nA cramp work station hinders  productivity.   ', 'main/img/blogs/BLOGS 1.jpg', '2016-04-12', 'main/img/blogs/blog1t.jpg');
INSERT INTO `blog` (`blog_id`, `title`, `author`, `author_img`, `blog_details`, `supporting_img`, `date_inserted`, `thumb`) VALUES
(14, 'Comfortable Seating Arrangement', 'Zahra Salmorin', , 'Working an office job is no easy task.  It is hard on your back especially  if you  sit in a chair all day.  To eliminate that problem,\r\nyou need to have  a comfortable  chair to sit on while you work.  One that can support your back and of course be comfortable\r\non your bottom.  You may love the selections that Jecams  has for seating arrangements.   ', 'main/img/blogs/BLOGS2.jpg', '2016-04-12', 'main/img/blogs/blog2t.jpg');
INSERT INTO `blog` (`blog_id`, `title`, `author`, `author_img`, `blog_details`, `supporting_img`, `date_inserted`, `thumb`) VALUES
(15, 'Carpeted  Floor', 'Zahra Salmorin', , 'If you wish to offer the comfort of carpet in your establishment, Jecams has that too.   We have a huge selection of carpet, tile carpet,\r\n and roll carpet to choose from.  Materials and labor are all included in the price of 1,500 per sqm. When you purchase carpet from Jecams,\r\n it is always a great deal with labor included in the price. \r\n <br/>\r\nYou can also rest assured the installation will done right by a skilled Jecams installer.  You may  love the pattern of this tile carpet style. \r\n It''s modern and refreshing.  ', 'main/img/blogs/BLOGS3.jpg', '2016-04-12', 'main/img/blogs/blog3t.jpg');
INSERT INTO `blog` (`blog_id`, `title`, `author`, `author_img`, `blog_details`, `supporting_img`, `date_inserted`, `thumb`) VALUES
(16, 'Restaurant Setting', 'Zahra Salmorin', , 'The first thing you notice when you enter a restaurant is usually the furniture and decor, not the food.\r\nAn impressive restaurant setting must have high quality furniture that provides a comfortable experience for the customers. \r\nSome restaurants have an outdoor seating area where people can enjoy a relaxing dinner with a beautiful view and most importantly\r\n have a comfortable seating arrangement.  Ambiance is everything when you have a restaurant. Jecams offers public seating, \r\nplastic chairs, high end chairs, stackable chairs, sofa, couch, coffee table, and more.  If you are in need of new furniture for your restaurant, \r\nJecams can help.  With our high end products, your restaurant will be visually appealing to your customers and you will get the durability \r\nexpected in a long term investment like furniture.  \r\n<br/>\r\nThe quote "You get what you pay for" is so true.  When you buy a high end  furniture, you \r\npay more because it lasts  longer or it is better  than the ones that are cheaply made.  In a customer''s point of view, I would rather pay  more\r\nfor a furniture that would last longer than a furniture that is  cheaper but  it would not last long.  ', 'main/img/blogs/BLOGS4.jpg', '2016-04-12', 'main/img/blogs/blog4t.jpg');
INSERT INTO `blog` (`blog_id`, `title`, `author`, `author_img`, `blog_details`, `supporting_img`, `date_inserted`, `thumb`) VALUES
(17, 'A Relaxing Retreat', 'Zahra Salmorin', , 'Most resorts offer a relaxing retreat with  fine amenities. Jecams offers a line of products that would be a great addition to any office, \r\nresort or spa, such as hardwood furniture , modular seating, restaurant furniture, pantry tables, and more.  Providing a relaxing\r\natmosphere for your clientele is crucial to overall success. \r\n <br/>\r\nYou want your furniture to represent the quality, strength, and longevity of your business. When you equipped your business with high end\r\nproducts, you can justify the price you are asking for the accommodation and stuff.  You can''t  charge   high if  the things  around your \r\nbusiness are poorly made.   You want a furniture supplier that understands your needs and provides the highest level of quality and\r\ncustomer support. Look no further than Jecams.\r\n<br/>\r\nCustomer satisfaction is one of our main goals and we can assist you with everything you need for your business.   \r\n', 'main/img/blogs/BLOGS5.jpg', '2016-04-12', 'main/img/blogs/blog5t.jpg');
INSERT INTO `blog` (`blog_id`, `title`, `author`, `author_img`, `blog_details`, `supporting_img`, `date_inserted`, `thumb`) VALUES
(18, 'Efficient and Functional', 'Zahra Salmorin', , 'Choosing the right office chair is crucial to overall productivity.  An office chair not only has to look stylish, it needs to be comfortable and \r\ndurable.  <br/>\r\nJecams offers an accordion wall system, operable wall systems, foldable partition, bookshelf, office chairs, center table, reception counter,\r\nand a lot more.  The only problem you will have with their stylish, high end  office  products, is choosing from their amazing selection. \r\nMany businesses wish to maximize their office space while creating a more conducive work environment for their employees.\r\n<br/>\r\nIf this is your goal, check out Jecams.\r\n', 'main/img/blogs/BLOGS6.jpg', '2016-04-12', 'main/img/blogs/blog6t.jpg');
INSERT INTO `blog` (`blog_id`, `title`, `author`, `author_img`, `blog_details`, `supporting_img`, `date_inserted`, `thumb`) VALUES
(19, 'screen panel divider and executive table', 'Zahra Salmorin', , 'Our screen panel divider and executive table pictured below looks modern and provides functional features that really\r\nmaximize available space.  The possibility is endless with Jecams, we do have a large selection of  high end office furniture\r\nthat would sure look faboulous  in any  business setting.', 'main/img/blogs/BLOGS7.jpg', '2016-04-12', 'main/img/blogs/blog7t.jpg');
INSERT INTO `career` (`job_id`, `job_title`, `job_qualification`, `job_duty`, `ads`, `created_at`, `updated_at`) VALUES
(1, 'Sales Executive', 'Graduate of BSBA major in Marketing or any 4-year course.\r\nPreferably with at least 2 year experience in Sales/Marketing.\r\nMotivated and can work in minimal supervision.\r\nHas good moral character and flexibility.\r\nCan communicate effectively.\r\nGood Communication and customer service skills\r\nGood interpersonal skills.\r\n', 'Sales executives promote products and services to customers or clients and negotiate contracts with the aim of maximizing sales profits.\r\nIdentifies business opportunities by identifying prospects and evaluating their position in the industry; researching and analyzing sales options. \r\nSells products by establishing contact and developing relationships with prospects; recommending solutions.\r\nMaintains relationships with clients by providing support, information, and guidance; researching and recommending new opportunities; recommending profit and service improvements.\r\nidentifies product improvements or new products by remaining current on industry trends, market activities, and competitors.\r\nPrepares reports by collecting, analyzing, and summarizing information.\r\nMaintains quality service by establishing and enforcing organization standards.\r\nMaintains professional and technical knowledge by attending educational workshops; reviewing professional publications; establishing personal networks; benchmarking state-of-the-art practices; participating in professional societies.\r\nContributes to team effort by accomplishing related results as needed.\r\n', 'img/career/sales.jpg', '2017-02-17 03:48:17', '0000-00-00 00:00:00'),
(2, 'Licensed Architect', 'Candidate must possess at least a Bachelor’s/ College Degree, Architecture, preferably with license\r\nRequired language(s): English & Filipino.\r\nMinimum of 2 Years Experience in construction of retail outlets, commercial outlets, restaurants, house, low rise building.\r\nWith the good moral attitude, integrity and possess sense of urgency.\r\nGood in communication to different Department\r\nWalk in applicant will be prioritized.\r\n', 'Attend customer meetings with sales or teams to develop project.\r\nDevelop conceptual drawings and sketches that support projects in the floor plan.\r\nLead design review with customers and sales.\r\nDevelop CAD drawings for proposals and/or presentations on projects based on project requirements.\r\nSupport new product development and launches.\r\nEstablish and manage drawing and document management process and standards with manufactures and field organization.\r\nWorks with Sales, Operations and management to deliver projects from the quality to closeout stages.\r\nDrive customer satisfaction as they relate to custom projects and bid proposals.\r\n', 'img/career/archi.jpg', '2017-02-17 03:48:02', '0000-00-00 00:00:00');
