INSERT INTO `testimonials` (`record_id`, `message`, `author`, `company`, `date_inserted`, `company_logo`, `created_at`, `updated_at`) VALUES
(1, 'The Local Government Unit of Urdaneta city Ordered customized cubicles,office tables and chairs and everything was carried out as expected. Found the whole process from ordering to delivery excellent and really pleased with the service from the company. Would definitely order again for any office supplies needed.Sales agent Micca Beltran was so helpful as well thanks to her great cooperation throughout the process.', 'Mi-Amor L. Divad', 'Exec. Asst. III - Mayor''s Office LGU Urdaneta City', '2015-11-06', 'img/testimonials/Urdaneta.jpg', '2017-02-16 00:26:04', '0000-00-00 00:00:00'),
(2, 'I recently ordered and purchased a few desks and chairs from your company. I am not based in the Philippines, so it was important for me to get good desks for my Makati office fast. I was prepared for the worst as I was only in the Philippines for less than 2 weeks. However, I was pleasantly surprised by the AMAZING CUSTOMER SERVICE and ATTENTION, I received from Marie Valencerina who took care of visiting my site, getting temporary tables/chairs set up, and delivering the necessary tables and chairs. This was an amazing customer experience on par with the leading companies I have dealt with in the United States. I can''t say how much I enjoyed working with your company and Marie. I am a VERY satisfied customer and will be recommending your company to others.', 'Anton Dy Buncio', 'Chief Operating Officer - VIATechnick', '2015-11-06', 'img/testimonials/Via Technik.jpg', '2017-02-16 00:26:04', '0000-00-00 00:00:00'),
(3, 'I am writing to let you know how pleased I am with the products and services of Jecams. We only found your company on website and was satisfied with the way of how you handled your clients. Good thing that you also have skype as a mean of communication. For the payment, we’re happy that you agreed on our terms. The products were delivered in its good condition. You also have nice and friendly staff.', 'Mariecris Soriente', 'Lead Generation Specialist - D&V Philippines', '2015-11-06', 'img/testimonials/D and V Philippines.jpg', '2017-02-16 00:26:04', '0000-00-00 00:00:00'),
(4, 'After had a transaction with your company, I would like to let you know that we are pleased with the products and services of Jecams Inc. Actually, we only found your company on website and was satisfied so far with the result of our delivered conference tables and chairs. Very fast transaction and the products were delivered in good condition. We will surely contact your Company again to our future needs of Office Furnitures.\r\n\r\nMore Power!!!', 'Rhea Rose C. Robles ', 'Admin Staff - Tose Philippines', '2015-11-06', 'img/testimonials/Tose Software Philippines.jpg', '2017-02-16 00:26:04', '0000-00-00 00:00:00'),
(5, 'We purchased workstation, table with partition to Jecams Inc. I could say the quality is very good and affordable And they are so fast even they delivered and install before the deadline date. \r\nTheir installer/workers are polite and accommodating Special mention to Account Executive Ms Marie Valencerina To her excellent service and assistance I will definitely recommend Jecams Inc. to our sister companies and Will surely contact them to our future needs for Office Furniture. \r\nMore Power and God Bless!', 'Meng Gumilet', 'Admin and Accounting Manager - Jollyb- Box', '2015-11-06', 'img/testimonials/Jolly B Box.jpg', '2017-02-16 00:26:04', '0000-00-00 00:00:00'),
(6, 'After had a transaction with Ms. Zaida a couple of times.I can say that she has a good performance, she handles our request well. She responds quickly everytime we asked for a favor.But overall Ms. Zaida performes well as sales-PIC in KDDI.', 'Jenicel V. Torres ', 'Sr. Sales Coordinator - KDDI PHILS.CORP', '2015-11-06', 'img/testimonials/KDDI.jpg', '2017-02-16 00:26:04', '0000-00-00 00:00:00'),
(7, 'Thank you for your kind assistance and we look forward to dealing with you again in the future.', 'Mikaela C. Naval ', 'Local Staff - Embassy of the State of Kuwait - Manila', '2015-11-06', 'img/testimonials/Embassy of Kuwait.jpg', '2017-02-16 00:26:04', '0000-00-00 00:00:00'),
(8, 'I just wanted to take this opportunity to say “thank you” for your timely service and construction of our furniture. You service has been impeccable, and we will have no problem referring business to you or using your company again. Thank you.', 'Brent Rogers ', 'Director - Inspire Education', '2015-11-06', 'img/testimonials/Inspire Education.jpg', '2017-02-16 00:26:04', '0000-00-00 00:00:00'),
(9, 'I really had a great customer service assistance from Joshua Saylo, eversince I contacted Jecams. He was so helpful with my needs and very accommodating as well. I have dealt with pther suppliers before but his assistance is different. He knows what he''s doing, he has answers to everything. \r\nI will be recommending him to my friends who are setting up new business in the future \r\nYou are a blessing, Joshua!', 'Katherine Quiles ', 'Innovatus Group', '2015-11-06', 'img/testimonials/Innovatus Group.jpg', '2017-02-16 00:26:04', '0000-00-00 00:00:00'),
(10, 'I was really impressed with Jecams Inc. because they are always accommodating my requests promptly. They really made an effort to bring their furniture as samples in our company. From the quotation down to the quality of your products and services, we are really satisfied. In behalf of our company,\r\nTHANK you Jecams Inc.! Thank you Ms. Jannie Foster! Keep up the good work! I will recommend you with our customers.', 'Kimberly Rose Catapat', ' A CJ O Shopping Corporation', '2015-11-07', 'img/testimonials/oshopping.jpg', '2017-02-16 00:26:04', '0000-00-00 00:00:00'),
(11, 'Ms. Sam Francisco is a customer friendly and welcoming. I felt comfortable and confident that all of my queries regarding Jecams Inc.’ products have been handled competently, and I was impressed by the way she assisted us from answering phone, handling orders, follow ups, delivery tracking and after sales services. She is highly commendable for her job well done and admiring competencies.', 'EDSEL P. SANCHEZ ', ' INAEC Aviation Corporation', '2015-11-07', 'img/testimonials/Inaec.jpg', '2017-02-16 00:26:04', '0000-00-00 00:00:00'),
(12, 'Jecams Inc. is very accommodating with our inquiry about their products and staffs are very friendly and professional. We are very satisfied with the product that we purchased from Jecams.', 'Berwin Yap', 'Ecommerce Websites Australia', '2015-11-07', '', '2017-02-16 00:26:04', '0000-00-00 00:00:00'),
(13, 'Dear Ms. Angie, \r\nIn behalf of Arca Galleon, we would like congratulate you for a job well done. We are very happy and satisfied with the conference table and your service as well. Thank you and ‘til our next transaction!', 'LOUIE ANJEANETTE P. MARTINEZ ', 'ARCA GALLEON AGRIVENTURES, INC.', '2015-11-07', 'img/testimonials/Arca Galleon.jpg', '2017-02-16 00:26:04', '0000-00-00 00:00:00'),
(14, 'JECAMS played a big role during our office build-out last year. With Ms. Angie Buenconsejo at the helm, they patiently adhere to the details of our workstations such as revisions on their existing design, our own choice of chairs and tables.\r\n\r\nMs. Angie would always make sure of the prompt delivery of these items and always accommodating when it comes to product inquiries. It has never been a burden in transacting business with them.\r\n\r\nKudos to Ms. Angie of JECAMS Inc.!', 'Jonathan Cantada (Admin Manager)', 'Prime Advisory Research Services Asia, Inc.', '2016-02-19', 'img/testimonials/Prime Advisory Research.jpg', '2017-02-16 00:26:04', '0000-00-00 00:00:00'),
(15, 'Greetings!\r\n\r\nWe selected the Company of Jecams Inc. because they meet our expectation and the quality is good, they are open for the suggestions we wants, \r\nthey have a good service and attitude employees. \r\n\r\nThe benefit we get to their company is to have a comfortable and good ambiance  for our Company.\r\n\r\nThank you.', 'Purchasing Department', 'Silver Star Resources Co. Inc', '2016-03-14', 'img/testimonials/Silver Star.jpg', '2017-02-16 00:26:04', '0000-00-00 00:00:00'),
(16, 'HI Ms. Angie,\r\n \r\nIn behalf of Superl, thank you for your prompt reply on my inquiry, and the very accommodating services to us. We are happy that you really fixed the problem if we have complain. Also when I ask discount you are very honest to answer if the price cannot be reduce.\r\n \r\nTill on my next order, maintain the quality and good services to any company.', 'Airene B. Fernando (Purchasing Department)', 'Superl Philippines, Incorporated', '2016-04-14', 'img/testimonials/Superl Philippines.jpg', '2017-02-16 00:26:04', '0000-00-00 00:00:00'),
(17, 'In behalf of Carewell Health Systems Inc. We just wanted to let you know how pleased we are with our new office workstation. \r\nMs. Angie Buenconsejo and her co-employee did an outstanding job on it, and we have received nothing but compliments on how \r\nwell it is constructed. They all did a wonderful job and we appreciate your work and will highly recommend your company to others. \r\n\r\nThank you and more power!', 'CECIL M. HERNANDEZ', 'Carewell Health Systems Inc.', '2016-04-26', 'img/testimonials/Carewell Health Systems.jpg', '2017-02-16 00:26:04', '0000-00-00 00:00:00'),
(18, 'In behalf of Millennium Challenge Account-Philippines, I''d like to express my sincerest gratitude to Jecams, Inc. especially to Ms. Angie Buenconsejo. I want to thank Ms. Angie for her commitment and dedication. I also commend her for having a winner’s attitude. She thinks positively in every aspect of the project. She even takes the initiative in giving good suggestions and sharing her knowledge and experience. Again, thank you, Ms. Angie, from the bottom of my heart for an excellent job and for your assistance to us. God bless you more!', 'Warren Paul A. Nicdao', 'Procurement Analyst - Millennium Challenge Account-Philippines', '2016-06-07', 'img/testimonials/Millenium Challenge Philippines.jpg', '2017-02-16 00:26:04', '0000-00-00 00:00:00'),
(23, 'Among five suppliers we''ve reached out to, you are the most prompt in replying which is very important to me. It shows how professional you are as a company and that you value each client, whether it be just a query or a closed sale eventually. Thank you very much.', 'Ms. Carol Sajonas', 'NAPA GAPA BEVERAGES CORP.', '2017-02-16', '', '2017-02-15 17:09:07', '2017-02-15 17:09:07'),
(24, 'Keep up the good work and I am looking forward for more transactions with you.', 'Ms. Mary Grace Agila', 'SOUTH FIELD AGENCIES INC.', '2017-02-16', 'img/testimonials/southfield.jpg', '2017-02-16 02:57:22', '2017-02-15 17:09:51'),
(30, 'Kudos to Ms. Zaida. She is always attentive on my concern regarding requesting a quotation. Keep up always', 'Mr. Jayson Caruyan', 'GLOBE TELECOM, INC.', '2017-02-16', 'img/testimonials/globe.jpg', '2017-02-15 18:59:49', '2017-02-15 18:59:49');
